INSERT INTO `pages_element` VALUES (1,'Первый элемент','elements/images/Журнал.png','elements/images/webp/Журнал.webp','У нас в ассортименте вы найдете все необходимое для качественного питания: свежие яйца, высококачественную муку разных сортов, разнообразные крупы, макароны, консервацию и растительные масла.'),(2,'Второй элемент','elements/images/home-top-1_6B0XxbM.webp','elements/images/webp/home-top-1_6B0XxbM.webp','Наша компания осуществляет доставку продуктов питания бакалейной группы в рестораны, магазины, санатории, кондитерские и оптовые базы по всему городу Сочи. Мы охватываем все районы, обеспечивая быструю и надежную доставку в любое время.'),(3,'Третий элемент','elements/images/66666_j2k6aQa.jpg','elements/images/webp/66666_j2k6aQa.webp','Мы работаем только с проверенными производителями, что гарантирует высокое качество нашей продукции. Наша цель — предложить вам лучшие продукты, которые станут основой для ваших кулинарных шедевров. С нами вы получите только самое лучшее для вашего бизнеса и дома.');
/*!40000 ALTER TABLE `pages_element` ENABLE KEYS */;
UNLOCK TABLES;

