INSERT INTO `pages_grocery` VALUES (1,'Яйца','','groceries/images/eggs.jpg','groceries/images/webp/eggs_4IgYdeF.webp','Свежие и качественные яйца для вашего стола.','У нас представлена широкая линейка яиц разных сортов и цветов от Таганрогской и Свердловской птицефабрик.','eggs'),(2,'Мука и макаронные изделия','certificates/Старый_оскол.png','groceries/images/категория_муки.webp','groceries/images/webp/категория_муки_H2PIQxV.webp','Разнообразие муки и макаронных изделий на любой вкус.','У нас представлена продукция Старооскольского мукомольного завода, входящего в состав ТД \"Оскольская Мука\", мельничного хозяйства \"Лада\" под управлением ТД \"Аверс\".','flour'),(3,'Крупы и злаки','certificates/Основва.png','groceries/images/cereal.jpg','groceries/images/webp/cereal_OyiElaB.webp','Высококачественные крупы и злаки от проверенных производителей.','У нас широкий ассортимент разных видов круп и злаковых торговой марки \"Основа\" и \"Бакалейная лавка\".','cereal'),(4,'Консервация','certificates/Сертификат_дистрибьютора_2027_kcgCu4p.jpeg','groceries/images/canned.jpg','groceries/images/webp/canned_IoiSUtT.webp','Разнообразные консервы, включая овощные, фруктовые и мясные.','Мы сотрудничаем с производственным объединением провереных заводов \"Знаток\" изготавливающих консервы высшей категории качества.','canned');
